import React from "react";
import { useLocation } from "react-router-dom";
import axios from "axios";
import "./Review.css";

function Review() {
  const location = useLocation();
  const data = location.state || {};

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      // Uncomment the line below when the API endpoint is ready
      const response = await axios.post("http://localhost:3001/flows", data);
      console.log("Data saved to the server");
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="review-container">
      <h1>Review Configurations</h1>
      <div className="review-data">
        <pre>{JSON.stringify(data, null, 2)}</pre>
      </div>
      <button className="review-submit-btn" onClick={handleSubmit}>
        Submit
      </button>
    </div>
  );
}

export default Review;
